import React from 'react';
import { useNavigate } from 'react-router-dom';
import Header from './Header';
import SideNavBar from './SideNavBar';

const NotFoundPage = () => {
  const navigate = useNavigate();

  return (
    <div className="h-screen flex flex-col overflow-hidden overflow-y-auto">
      <Header />
      <SideNavBar />
      <div
        className="flex-grow bg-cover bg-center flex flex-col items-center justify-center px-4 pb-36"
        style={{
          backgroundImage: "url('/images/background.svg')",
        }}
      >
        <div className="text-center bg-white bg-opacity-80 p-8 rounded-2xl shadow-lg">
          <h1 className="text-4xl font-bold text-indigo-600 mb-4">404</h1>
          <p className="text-lg text-gray-800 mb-6">The page doesn&apos;t exist.</p>
          <button
            onClick={() => navigate('/')}
            className="px-6 py-3 bg-indigo-600 text-white rounded-xl hover:bg-indigo-700 transition"
          >
            Go back to Home
          </button>
        </div>
      </div>
    </div>
  );
};

export default NotFoundPage;
